import React, { Component } from "react";
import StackGrid from "react-stack-grid";

class Sandbox extends Component {
  render() {
    return (
      <StackGrid
        columnWidth={150}
      >
        <div key="key1"><img src="/images/sq_thumb/1.jpg" /></div>
        <div key="key2"><img src="/images/sq_thumb/1.jpg" /></div>
        <div key="key3"><img src="/images/sq_thumb/1.jpg" /></div>
      </StackGrid>
    );
  }
}

export default Sandbox;
